import styled from "styled-components";
import backImg from "./img/background.png";
import { CloseButton } from "./styledComponents/CloseButtonInCalculation";
const MainWrapperDiv = styled.div`
  background-image: url(${backImg});
  height: 1204px;
`;
const SecondWrapperDiv = styled.div`
  width: 90%;
  margin: auto;
`;
const StaticP = styled.p`
  text-align: center;
  font-family: "Segoe UI", sans-serif;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 19px;
  /* identical to box height */

  letter-spacing: 0.15em;
  margin-top: 25px;
  color: #ffffff;
`;

const CarbonValue = styled.p`
  text-align: center;
  font-family: "Segoe UI", sans-serif;
  font-style: normal;
  font-weight: bold;
  font-size: 24px;
  line-height: 19px;
  /* identical to box height */

  letter-spacing: 0.15em;
  margin-top: 25px;
  color: #ffffff;
`;

console.log(backImg);
export const AnnualCarbonFootprintShow = () => {
  return (
    <MainWrapperDiv>
      <SecondWrapperDiv>
        <CloseButton></CloseButton>
        <StaticP>YOUR ANNUAL CARBON FOOTPRINT</StaticP>
      </SecondWrapperDiv>
    </MainWrapperDiv>
  );
};
